description:
SMS in a box is an SMS gateway and enables you to build your own SMS based services. Use it to deliver ringtones via WAP PUSH or send and receive text messages from your web applications.

SMS in a box is easily managed through a web 2.0 interface relying heavily on AJAX and supports GSM hardware devices as well as HTTP-&gt;SMS providers such as Clickatell.

Read more at http://frameworx.dk/smsinabox

